import React, { useEffect, useContext } from "react";
import HomeAuditorCards from "../components/HomeAuditorCards";
import HomeAuditorTabs from "../components/HomeAuditorTabs";
import Navbar from "../Navbar";
import CssBaseline from "@material-ui/core/CssBaseline";
import { Context } from "../Context";
import Loading from "./Loading";

function HomeAuditor() {
  const { getAudits, auditsState, setAuditsState } = useContext(Context);

  useEffect(() => {
    const username = sessionStorage.getItem("authenticatedUser");

    async function getResponse() {
      const requestForId = await getAudits(username).then((response) => {
        return response.data;
      });

      //array with all the report ids of audits done by auditor
      const reportIdArray = [
        ...requestForId.CLOSED.completed_audits,
        ...requestForId.OPEN.outstanding_audits,
      ];
      setAuditsState(reportIdArray);
      // const requestForInfo = await
    }
    getResponse();

    // .then((response) => {
    //   console.log(response.data.CLOSED.completed_audits);
    //   console.log(response.data.OPEN.outstanding_audits);
    //   setAuditsState([
    //     ...response.data.CLOSED.completed_audits,
    //     ...response.data.OPEN.outstanding_audits,
    //   ]);
    // })
    // .catch(() => {
    //   console.log("Failed to retrieve audits");
    // });
  }, []);

  return (
    <div>
      {auditsState ? (
        <>
          <CssBaseline />
          <Navbar />
          <HomeAuditorTabs />
          <HomeAuditorCards />
        </>
      ) : (
        <Loading />
      )}
    </div>
  );
}

export default HomeAuditor;
